import React from 'react'
import TodoForm from './TodoForm';
const NewTodo = (props) => {
  const newtodo = (enterTodo) => {
    const data = {
      ...enterTodo,
      id: Math.random().toString(),
    };
    props.onAddTodo(data);
  };

  return (
    <div>
      <ToDoForm onSaveData={newtodo} />
      <button>Clear</button>
    </div>
  );
};

export default NewTodo
